import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('roboto-variablefont_wdthwght-webfont-normal.ttf', font);
this.addFont('roboto-variablefont_wdthwght-webfont-normal.ttf', 'roboto-variablefont_wdthwght-webfont', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
